import { HttpClient, HttpResponse } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { CarteTransfusionnellePatient } from '../models/CarteTransfusionnellePatient';

@Injectable({
  providedIn: 'root'
})
export class CartetransfService {

  private apiUrl = 'https://localhost:7129/api/CarteTransfusionnellePatient';

  constructor(private http: HttpClient) { }

  Create2(CarteTransfusionnellePatient: CarteTransfusionnellePatient): Observable<HttpResponse<any>> {
    return this.http.post<any>(`${this.apiUrl}/Create2`, CarteTransfusionnellePatient, { observe: 'response' });
  }

}
